import Layout from "../components/Layout";
import { Block } from "../components/Block";
import { DarkBlock } from "../components/DarkBlock";
const HomePage = () => {
  return (
    <Layout>
      <Block />
      <DarkBlock />
    </Layout>
  );
};

export default HomePage;
